  `temperatureUnit` int(10) DEFAULT 0 COMMENT '温度类型 0：摄氏度 1 华氏度',
  `statueBar` int(10) DEFAULT 1 COMMENT '状态栏：0 不显示，1 显示',
  `navigationBar` int(10) DEFAULT 1 COMMENT '导航栏 0 不显示，1 显示',
  `delayTime` int(10) DEFAULT 5 COMMENT '延迟关门时间',
  `temperatureAlert` float(5,1) DEFAULT 37.3 COMMENT '报警温度',
  `faceRecognizeValue` float(5,1) DEFAULT 0.7 COMMENT '人脸识别阈值 0到1',
  `maskValue` float(5,1) DEFAULT 0.8 COMMENT '口罩检测阈值 0到1',
  `RGBValue` float(5,1) DEFAULT 0.5 COMMENT 'RGB阈值 0到1',
  `IRValue` float(5,1) DEFAULT 0.7 COMMENT 'IR活体阈值 0到1',
  `brightness` float(5,1) DEFAULT 0.5 COMMENT '亮度值 0到1',
  `openDoorRule` int(10) DEFAULT 0 COMMENT '开门规则：0:只检测人脸; 1 只检测NFC; 2  人脸和NFC都要同时检测',
  UNIQUE KEY `unique` (`deviceSn`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

