  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '登录日志编号',
  `mem_id` bigint(20) unsigned NOT NULL DEFAULT 0 COMMENT '会员编号',
  `head_info` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '头部信息',
  `login_time` int(11) unsigned DEFAULT 0 COMMENT '登录时间',
  `login_ip` varchar(20) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '登录IP',
  PRIMARY KEY (`id`),
  KEY `mem_id` (`mem_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3518 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='会员登录日志';

