/*Table structure for table `zh_member` */

DROP TABLE IF EXISTS `zh_member`;

CREATE TABLE `zh_member` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '会员编号',
  `role_id` int(10) NOT NULL DEFAULT 0 COMMENT '会员角色编号',
  `owner1` int(5) DEFAULT 0,
  `owner2` int(5) DEFAULT 0,
  `username` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '帐号',
  `password` varchar(60) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '密码',
  `name` longtext COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '姓名',
  `tel` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '电话',
  `nickname` longtext COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '昵称',
  `sex` tinyint(1) unsigned DEFAULT 0 COMMENT '性别 1男 2女 0未知',
  `qq` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT 'QQ',
  `wechat` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '微信',
  `email` varchar(150) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '邮箱',
  `mobile` varchar(20) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '手机号',
  `mobile_md5` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `head_url` longtext COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '头像地址',
  `sign` varchar(250) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '个性签名',
  `province` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '省份',
  `city` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '城市',
  `area` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '区域',
  `addr` varchar(150) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '详细地址',
  `verify_status` tinyint(1) unsigned DEFAULT 1 COMMENT '审核状态',
  `auth_status` tinyint(1) unsigned DEFAULT 0 COMMENT '认证状态',
  `login_modify_pwd` tinyint(1) unsigned DEFAULT 0 COMMENT '登录时强制修改密码（登录时，是否跳转到密码修改页）',
  `regist_time` int(11) unsigned DEFAULT 0 COMMENT '注册时间戳',
  `regist_ip` varchar(20) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '注册IP',
  `last_login_time` int(11) unsigned DEFAULT 0 COMMENT '最后登录时间戳',
  `last_login_ip` varchar(20) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '最后登录IP',
  `update_time` int(10) NOT NULL DEFAULT 0 COMMENT '会员更新',
  `begin_expire_time` datetime DEFAULT NULL,
  `expire_time` datetime DEFAULT NULL COMMENT '有效期',
  `points` int(10) DEFAULT 0 COMMENT '会员积分',
  `allow_devices` int(10) DEFAULT 20,
  `current_devices` int(10) DEFAULT 0,
  `department_p` int(10) DEFAULT NULL,
  `department_s` int(10) DEFAULT NULL,
  `position` int(10) DEFAULT NULL,
  `face_token` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `call_times` int(10) DEFAULT 0 COMMENT '调用接口次数',
  `call_success` int(10) DEFAULT 0 COMMENT '调用成功次数',
  `allow_calls_per_month` int(10) DEFAULT 500,
  `timezone` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `cardnumber` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `blacklist` tinyint(4) DEFAULT 0,
  `temperature_unit` tinyint(3) DEFAULT 1 COMMENT '1:摄氏温度，2：华氏温度',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`) USING BTREE,
  KEY `role_id` (`role_id`),
  KEY `owner2` (`owner2`) USING BTREE,
  KEY `password` (`password`,`mobile_md5`,`cardnumber`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4187 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='会员帐号';

/*Data for the table `zh_member` */

