/*Table structure for table `zh_message` */

DROP TABLE IF EXISTS `zh_message`;

CREATE TABLE `zh_message` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '消息编号',
  `title` varchar(200) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '标题',
  `content` text COLLATE utf8_unicode_ci NOT NULL COMMENT '内容',
  `target` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '阅读对象 all, vendor, channel, merchant',
  `mem_id` bigint(20) unsigned DEFAULT 0 COMMENT '操作者',
  `file` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '附件',
  `status` tinyint(1) unsigned DEFAULT 0 COMMENT '发布状态 1已发布，0未发布',
  `send_time` int(10) unsigned DEFAULT 0 COMMENT '发布时间',
  `create_time` int(10) unsigned DEFAULT 0 COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `target` (`target`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='消息通知表';

