/* Trigger structure for table `zh_verify_logs` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `after_insert_timelogs` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `after_insert_timelogs` AFTER INSERT ON `zh_verify_logs` FOR EACH ROW BEGIN
	INSERT INTO `2hrisdbic`.`faceid_logs`
		    (
		     `acct_id`,
		     `work_date`,
		     `work_time`,
		     `time_type`,
		     `temp`
		     )
	SELECT CASE WHEN user_id = '4186' THEN '1055' ELSE '1055' END, DATE_FORMAT(verify_time, '%Y-%m-%d'), DATE_FORMAT(verify_time, '%H:%i'), CASE WHEN device_name LIKE '%Entrance%' THEN 'C/I' ELSE 'C/O' END, temperature FROM faceid.zh_verify_logs ORDER BY id DESC LIMIT 1;
    END */$$


DELIMITER ;

/* Procedure structure for procedure `psp_insertlogs` */

/*!50003 DROP PROCEDURE IF EXISTS  `psp_insertlogs` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `psp_insertlogs`()
BEGIN
DECLARE acctid VARCHAR(10);
DECLARE workdate VARCHAR(20);
DECLARE worktime VARCHAR(10);
DECLARE timetype VARCHAR(4);
DECLARE emp_temp VARCHAR(10);
DECLARE done INT DEFAULT FALSE;
DECLARE cursor_select CURSOR FOR SELECT CASE WHEN user_id = '4186' THEN '1055' ELSE '1055' END,convert(DATE_FORMAT(verify_time, '%Y-%m-%d'),varchar(20)), convert(DATE_FORMAT(verify_time, '%H:%i'),varchar(10)), CASE WHEN device_name LIKE '%Entrance%' THEN 'C/I' ELSE 'C/O' END, temperature FROM  faceid.zh_verify_logs WHERE DATE_ADD(CURRENT_TIMESTAMP(),INTERVAL -1 HOUR) < verify_time;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
OPEN cursor_select;
read_loop: LOOP
FETCH cursor_select INTO acctid, workdate, worktime,timetype,emp_temp;
	IF done THEN
	LEAVE read_loop;
	END IF;	
	IF NOT EXISTS(SELECT * FROM 2hrisdbic.tbltimelogs WHERE acct_id = acctid AND  work_date=workdate AND work_time = worktime) then	
		
		INSERT INTO 2hrisdbic.tbltimelogs (acct_id,work_date,work_time,time_type,temp) VALUES(acctid, workdate, worktime,timetype,emp_temp);
		
		#CALL psp_updatetimelogs('FACE');
		#CALL psp_logspairing(acctid,workdate,'FACE01');
	END IF;	
	
END LOOP;
CLOSE cursor_select;
    END */$$
DELIMITER ;

